//Function that returns the active session to be displayed
function ActiveSessionCheck({ sessionStatus, focusTimer, breakTimer }) {
  if (sessionStatus === "Focusing") {
    return focusTimer;
  } else {
    return breakTimer;
  }
};

export default ActiveSessionCheck;
